INSERT INTO `eworxes_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES
(4, 2, 'Sobre Nós', '&lt;p&gt;Sobre Nós&lt;/p&gt;\r\n'),
(5, 2, 'Termos &amp; Condições', '&lt;p&gt;Termos &amp;amp; Condições&lt;/p&gt;\r\n'),
(3, 2, 'Política De Privacidade', '&lt;p&gt;Política De Privacidade&lt;/p&gt;\r\n'),
(6, 2, 'Informações de Entrega', '&lt;p&gt;Informações de Entrega&lt;/p&gt;\r\n'),
(7, 2, 'Treinamentos', '&lt;div id=&quot;cursomain&quot;&gt;\r\n&lt;div id=&quot;curso&quot;&gt;\r\n&lt;h1&gt;&lt;a href=&quot;http://www.eunicetreinamentos.com.br/cursos/Curso_Avancado_em_Ceramica_2013.pdf&quot; target=&quot;_blank&quot;&gt;CURSO AVANÇADO EM CERÂMICA&lt;/a&gt;&lt;a href=&quot;http://eunicesolucoes.web1129.kinghost.net/index.php?route=information/information&amp;amp;information_id=8&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;image/data/curso/Giovani_Gambogi.jpg&quot; title=&quot;&quot; /&gt;&lt;/a&gt;&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;ministrador&quot;&gt;Ministrador: &lt;strong&gt;MDT GIOVANI GAMBOGI PARREIRA&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;h2&gt;PROGRAMA (10 módulos curso completo):&lt;/h2&gt;\r\n\r\n&lt;h3&gt;CRONOGRAMA:&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;p&gt;1º módulo (AGOSTO DIAS 09 E 10): Duração: Carga horária 16 hrs.&lt;br /&gt;\r\n2º módulo (SETEMBRO DIAS 27 E 28).&lt;br /&gt;\r\n3º módulo e 4º módulo (NOVEMBRO DIAS 08 E 09 E DEZEMBRO).&lt;br /&gt;\r\n5º – Reinicio atividades após festas de final de ano.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Maiores informações e inscrições:&lt;br /&gt;\r\nLIGUE AGORA E GARANTA SUA VAGA&lt;/strong&gt;&lt;br /&gt;\r\nInscrições fones: 51 3029.0264 e 51 8125.0264&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Local:&lt;/strong&gt; PORTO ALEGRE –RS&lt;br /&gt;\r\nRua Marechal Floriano Peixoto, 91 conj.318&lt;br /&gt;\r\nCentro&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;APOIO:&lt;/strong&gt; EUNICE SOLUÇÕES&lt;br /&gt;\r\ne-mail: eunice@eunicesolucoes.com.br&lt;br /&gt;\r\n&lt;br /&gt;\r\n“ OPORTUNIADE IMPERDÍVEL ”&lt;br /&gt;\r\nfacilidade nos pagamentos em até 18 vezes.&lt;/p&gt;\r\n&amp;nbsp;\r\n\r\n&lt;div class=&quot;pdf&quot;&gt;&lt;a href=&quot;http://www.eunicetreinamentos.com.br/cursos/Curso_Avancado_em_Ceramica_2013.pdf&quot; target=&quot;_blank&quot;&gt;Saiba mais&lt;/a&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div id=&quot;curso&quot;&gt;\r\n&lt;h1&gt;&lt;a&gt;ABC DA METALO CERÂMICA&lt;/a&gt;&lt;img alt=&quot;&quot; src=&quot;image/data/curso/kayzer.jpg&quot; title=&quot;&quot; /&gt;&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;ministrador&quot;&gt;Ministrador: &lt;strong&gt;Kayser Yamada - &lt;/strong&gt;CD. TPD.&lt;/div&gt;\r\n\r\n&lt;h2&gt;DEFININDO DATAS&lt;/h2&gt;\r\n\r\n&lt;h3&gt;CRONOGRAMA:&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n&amp;nbsp;\r\n\r\n&lt;p&gt;&lt;strong&gt;1º Módulo (2 dias)&lt;/strong&gt;&lt;br /&gt;\r\n• Confecção modelo troquelado e rígido&lt;br /&gt;\r\n• Teoria sobre gesso.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;2º Módulo (2 dias)&lt;/strong&gt;&lt;br /&gt;\r\n• Enceramento diagnóstico para estrutura (Mocap e guia de desgate)&lt;br /&gt;\r\n• Enceramento da estrutura&lt;br /&gt;\r\n• Fundição (Técnicas de inclusão x Metais Part. Teórica)&lt;br /&gt;\r\n• Usinagem&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;3º Módulo (3 dias)&lt;/strong&gt;&lt;br /&gt;\r\n• Aplicação dos elementos em cerâmica (central, lateral e canino)&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Maiores informações e inscrições:&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n(51) 3029-0264&lt;br /&gt;\r\neunice@eunicesolucoes.com.br&lt;/p&gt;\r\n&amp;nbsp;\r\n\r\n&lt;div class=&quot;pdf&quot;&gt;&lt;a href=&quot;http://www.eunicetreinamentos.com.br/cursos/ABC_da_Metalo_Ceramica.pdf&quot; target=&quot;_blank&quot;&gt;Saiba mais&lt;/a&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div id=&quot;curso&quot;&gt;\r\n&lt;h1&gt;&lt;a&gt;TREINAMENTO E APERFEIÇOAMENTO&lt;br /&gt;\r\nDE CERÂMICA PARA INICIANTES&lt;/a&gt;&lt;img alt=&quot;&quot; src=&quot;image/data/curso/kayzer.jpg&quot; title=&quot;&quot; /&gt;&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;ministrador&quot;&gt;Ministrador: &lt;strong&gt;Kayser Yamada - &lt;/strong&gt;CD. TPD.&lt;/div&gt;\r\n\r\n&lt;h2&gt;25 E 26 DE JANEIRO DE 2013&lt;/h2&gt;\r\n\r\n&lt;h3&gt;CRONOGRAMA:&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n&amp;nbsp;\r\n\r\n&lt;p&gt;• Confecção de um central e um molar&lt;br /&gt;\r\n• Teórico e prático&lt;br /&gt;\r\n• Duração: 2 dias&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;HORÁRIO:&lt;/strong&gt; 8:30 HRS ÀS 18:00HRS&lt;br /&gt;\r\nINTERVALO PARA ALMOÇO&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Maiores informações e inscrições:&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n(51) 3029-0264&lt;br /&gt;\r\neunice@eunicesolucoes.com.br&lt;/p&gt;\r\n&amp;nbsp;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div id=&quot;curso&quot;&gt;\r\n&lt;h1&gt;&lt;a&gt;A ARTE DA ESCULTURA DENTAL&lt;/a&gt;&lt;img alt=&quot;&quot; src=&quot;image/data/curso/Ivan_Ronald.jpg&quot; title=&quot;&quot; /&gt;&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;ministrador&quot;&gt;Ministrador: &lt;strong&gt;Ivan Ronald - &lt;/strong&gt;CD. TPD.&lt;/div&gt;\r\n\r\n&lt;h2&gt;DIAS 26, 27 e 28 DE OUTUBRO DE 2012&lt;/h2&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;p&gt;• PARTE TEÓRICA COM APRESENTAÇÕES DE SLIDES;&lt;br /&gt;\r\n• ESCULTURA MORFO-FUNCIONAL DE 2 DENTES PÓSTERO-SUPERIORES;&lt;br /&gt;\r\n• ESCULTURA MORFO-FUNCIONAL DE 2 DENTES PÓSTERO-INFERIORES;&lt;br /&gt;\r\n• ESCULTURA DE 6 DENTES ANTERIORES.&lt;br /&gt;\r\nCARGA HORÁRIA (24 hs)&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;a href=&quot;http://www.facebook.com/photo.php?fbid=365955223491639&amp;amp;set=pb.284055725014923.-2207520000.1352860796&amp;amp;type=3&amp;amp;theater&quot; target=&quot;_blank&quot;&gt;&lt;strong&gt;Confira as fotos do treinamento &lt;/strong&gt;&lt;/a&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;ESTE TREINAMENTO JÁ FOI REALIZADO!&lt;/strong&gt;&lt;/p&gt;\r\n&amp;nbsp;\r\n\r\n&lt;div class=&quot;pdf&quot;&gt;&lt;a href=&quot;http://www.eunicetreinamentos.com.br/cursos/arte_da_escultura_dental.pdf&quot; target=&quot;_blank&quot;&gt;Saiba mais&lt;/a&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div id=&quot;curso&quot;&gt;\r\n&lt;h1&gt;&lt;a&gt;4º TURMA - TREINAMENTO AVANÇADO&lt;br /&gt;\r\nDE ESPECIALIZAÇÃO EM CERÂMICACurso de 10 meses&lt;/a&gt;&lt;img alt=&quot;&quot; src=&quot;image/data/curso/Giovani_Gambogi.jpg&quot; title=&quot;&quot; /&gt;&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;ministrador&quot;&gt;Ministrador: &lt;strong&gt;MDT GIOVANI GAMBOGI PARREIRA - &lt;/strong&gt;MDT Noritake / Kuraray&lt;/div&gt;\r\n\r\n&lt;h2&gt;INÍCIO EM MARÇO DE 2013&lt;/h2&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Ministradores Convidados:&lt;/strong&gt;&lt;br /&gt;\r\nDr. Leandro Medeiros (Materiais Dentários)&lt;br /&gt;\r\nDr. Maurício Riston (Oclusão)&lt;/p&gt;\r\n&amp;nbsp;\r\n\r\n&lt;div class=&quot;pdf&quot;&gt;&lt;a href=&quot;http://www.eunicetreinamentos.com.br/cursos/curso_giovani_2013_fev_turma4.pdf&quot; target=&quot;_blank&quot;&gt;Saiba mais&lt;/a&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div id=&quot;curso&quot;&gt;\r\n&lt;h1&gt;&lt;a&gt;TREINAMENTO E APERFEIÇOAMENTO EM CERÂMICA&lt;br /&gt;\r\n“NORITAKE”&lt;/a&gt;&lt;img alt=&quot;&quot; src=&quot;image/data/curso/Giovani_Gambogi.jpg&quot; title=&quot;&quot; /&gt;&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;ministrador&quot;&gt;Ministrador: &lt;strong&gt;MDT GIOVANI GAMBOGI PARREIRA - &lt;/strong&gt;MDT Noritake / Kuraray&lt;/div&gt;\r\n\r\n&lt;h2&gt;DIA 14 E 15 DE SETEMBRO DE 2012&lt;/h2&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;p&gt;• APLICAÇÃO DE INCISIVO CENTRAL EM INFRAESTRUTURA DE ZIRCONIA CAD - CAM&lt;br /&gt;\r\n&lt;br /&gt;\r\n• APLICAÇÃO EM INFRAESTRUTURA EM METAL NO MOLAR.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;ESTE TREINAMENTO JÁ FOI REALIZADO!&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;a href=&quot;http://www.facebook.com/media/set/?set=a.361386870615141.89601.284055725014923&amp;amp;type=3&quot; target=&quot;_blank&quot;&gt;&lt;strong&gt;Confira as fotos do treinamento&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;\r\n&amp;nbsp;\r\n\r\n&lt;div class=&quot;pdf&quot;&gt;&