(378, 2, 'CERÂMICA EX-3 DENTINA', '&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&lt;span style=&quot;line-height: 20.7999992370605px;&quot;&gt;Cerâmica Noritake EX-3 Dentina&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;ul style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;\r\n	&lt;li&gt;Apresentação: 16 cores (escala Vita) e 4 cores complementares A0, B0, A1,5 e A2,5&lt;/li&gt;\r\n	&lt;li&gt;Reposições: 10g e 50g&lt;/li&gt;\r\n	&lt;li&gt;Nomenclatura: A3B = B = body, dentina, corpo&lt;/li&gt;\r\n	&lt;li&gt;Queima: 600°C a 930°C&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;Informações Gerais da Cerâmica Noritake EX-3&lt;/p&gt;\r\n\r\n&lt;ul style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;\r\n	&lt;li&gt;Porcelana sintética (isenta de ferro).&lt;/li&gt;\r\n	&lt;li&gt;Contração mínima, fazendo com que se utilize menos material.&lt;/li&gt;\r\n	&lt;li&gt;Contração mínima de 3 a 5% (não contrai no espaço interdental e oclusal).&lt;/li&gt;\r\n	&lt;li&gt;Não há risco de escoamento na aplicação.&lt;/li&gt;\r\n	&lt;li&gt;Cores correspondentes com a escala Noritake.&lt;/li&gt;\r\n	&lt;li&gt;Dureza da porcelana muito próxima ao do dente natural (Dente Natural-450 Vickers X Porcelana EX3-530 Vickers).&lt;/li&gt;\r\n	&lt;li&gt;Sofre abrasão no meio bucal&amp;nbsp;acompanhando&amp;nbsp;o desgaste do dente natural.&lt;/li&gt;\r\n	&lt;li&gt;Coeficiente de expansão térmica = 12,4 X 10&lt;sup&gt;-6&lt;/sup&gt;&amp;nbsp;~ 14,6 X 10&lt;sup&gt;-6&lt;/sup&gt;.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;Indicação: Para metalo-cerâmica, laminados, inlay/onlay e jaqueta pura&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n', '', '', ''),
