(2297, 2, 'DENTE IVOCLAR VIVODENT - modelos anteriores', '&lt;h1 style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 10px 0px 20px; border: 0px; outline: 0px; font-size: 30px; vertical-align: baseline; color: rgb(87, 87, 87); font-family: ''Frutiger Next W02 Bold 724878'', Arial, sans-serif; -webkit-font-smoothing: antialiased; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;SR Vivodent PE&lt;/h1&gt;\r\n\r\n&lt;div class=&quot;clear&quot; style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 0px; vertical-align: baseline; clear: both; height: 0px; line-height: 0; font-family: ''FrutigerNextW02-Regular 724926'', Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;slogan&quot; style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; font-family: ''FrutigerNextW02-Regular 724926'', Arial, sans-serif; line-height: 19.6000003814697px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;\r\n&lt;div class=&quot;clear&quot; style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 0px; vertical-align: baseline; clear: both; height: 0px; line-height: 0; background: transparent;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;colContainer2 mBottom20&quot; style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; font-family: ''FrutigerNextW02-Regular 724926'', Arial, sans-serif; line-height: 19.6000003814697px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;\r\n&lt;div class=&quot;description mBottom20&quot; style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 22px; color: rgb(87, 87, 87); background: transparent;&quot;&gt;\r\n&lt;p style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px 0px 1.4286em; padding: 0px; border: 0px; outline: 0px; font-size: 1em; vertical-align: baseline; background: transparent;&quot;&gt;&lt;span style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-family: ''Frutiger Next W02 Bold 724878'', Arial, sans-serif; -webkit-font-smoothing: antialiased; background: transparent;&quot;&gt;Os dentes anteriores SR Vivodent PE apresentam um alto grau de rigidez, densidade, resistência a solventes e estabilidade de tom. Eles são indicados especialmente para próteses dentárias completas.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px 0px 1.4286em; padding: 0px; border: 0px; outline: 0px; font-size: 1em; vertical-align: baseline; background: transparent;&quot;&gt;Os dentes anteriores SR Vivodent PE também são indicados para a fabricação de dentaduras implantadas completas que precisam alcançar padrões estéticos excepcionalmente altos. Os dentes SR Vivodent PE apresentam um brilho perolado sutil.&lt;/p&gt;\r\n\r\n&lt;h3 style=&quot;line-height: 1.25; -webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1em; vertical-align: baseline; font-family: ''Frutiger Next W02 Bold 724878'', Arial, sans-serif; -webkit-font-smoothing: antialiased; background: transparent;&quot;&gt;Vantagens&lt;/h3&gt;\r\n\r\n&lt;ul style=&quot;padding-right: 0px; padding-left: 0px; -webkit-tap-highlight-color: transparent; margin: 0px 0px 0.8333em; border: 0px; outline: 0px; font-size: 1em; vertical-align: baseline; list-style-position: inside; background: transparent;&quot;&gt;\r\n	&lt;li style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;Altamente estéticos&lt;/li&gt;\r\n	&lt;li style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;Indicados principalmente para dentaduras completas&amp;nbsp;&lt;/li&gt;\r\n	&lt;li style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;Colos dentais com tons intensos&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p style=&quot;-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;&quot;&gt;OBS.: Cada placa possui&amp;nbsp;6 dentes.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n', '', '', ''),
