(2860, 2, ' BROCA DE TUNGSTENIO # 201801', '&lt;p&gt;&lt;span style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot;&gt;As brocas ou fresas de tungstênio OdontoMega oferecem o que existe de melhor no mercado. Grande variedade de modelos, com diferentes cortes (separados por cores) e diferentes aplicações, sendo para metais, gesso, resina acrílica e até mesmo zircônia pré-sinterizada. Além disso, todas brocas DFS possuem uma hélice, responsável por manter a poeira dos desgastes para fora do motor.&lt;/span&gt;&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; font-family: ''Open Sans'', sans-serif; font-weight: bold; font-stretch: inherit; line-height: 17px; vertical-align: baseline; color: rgb(102, 102, 102);&quot;&gt;Produtos Made in Germany, com o mais rigoroso processo de fabricação e controle de qualidade, com garantia de incrível durabilidade e alta eficiência no corte.&lt;/span&gt;&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot;&gt;Broca de Tungstênio Minicut&lt;/span&gt;&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot;&gt;Corte Cruzado Extra Fino&lt;/span&gt;&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot;&gt;15'' - 30000 rpm&lt;/span&gt;&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot;&gt;Aplicação:&lt;/span&gt;&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot;&gt;Estrutura da Zircônia pré-sinterizada&lt;/span&gt;&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot;&gt;Todos os Metais&lt;/span&gt;&lt;br style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(102, 102, 102); font-family: ''Open Sans'', sans-serif; line-height: 17px;&quot;&gt;Compósitos/Resinas&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n', '', '', ''),
