(2833, 2, ' PEDRA ABRAS. DIAM. ISA #183470', '&lt;p&gt;Pedras Abrasivas Diamantada para metalfree,zircônia, alumina e cerâmica&lt;br /&gt;\r\nAplicação:&lt;br /&gt;\r\n-Para Desgaste e Acabamento em Zirconia, Cerâmica, Alumina, Emax e demais Sistemas &quot;Metalfree&quot;.&lt;br /&gt;\r\nVantagens técnicas:&lt;br /&gt;\r\n-Baixa geração de calor;&lt;br /&gt;\r\n-Extrema capacidade de remoção de material, rápido e ininterrupto;&lt;br /&gt;\r\n-Não gera fagulhas/faíscas;&lt;br /&gt;\r\n-Não gera micro trincas no trabalho a seco;&lt;br /&gt;\r\n-Ideal para o trabalho manual;&lt;br /&gt;\r\n-Diamante 100% natural;&lt;br /&gt;\r\n-Baixa rotação (10.000 RPM);&lt;br /&gt;\r\n-Silencioso e livre de vibrações (centrada);&lt;br /&gt;\r\n-Garantia de qualidade conforme norma ISO;&lt;br /&gt;\r\nMelhor viabilidade econômica:&lt;br /&gt;\r\n-Alta durabilidade;&lt;br /&gt;\r\n-Alto rendimento de corte;&lt;br /&gt;\r\n-Melhor relação custo/benefício;&lt;br /&gt;\r\nO que são polidores diamantados?&lt;br /&gt;\r\nSão polidores de alto desempenho com grande quantidade de diamantes naturais os quais proporcionam um polimento de altíssima qualidade, baixíssimo aquecimento e alto brilho.&lt;br /&gt;\r\nSistema de retificar/lapidar diamantado com as excepcionais propriedades abrasivas através da liga especial diamantada. Para o trabalho/beneficiamento de superfícies cerâmicas.&lt;br /&gt;\r\nEm razão do desbaste com baixa geração de calor e alta remoção de material o sistema de desbaste e polimento é especialmente recomendado para o trabalho com cerâmica e zircônia..&lt;/p&gt;\r\n', '', '', ''),
(2834, 2, ' PEDRA ABRAS. DIAM. #183558', '&lt;p&gt;Pedras Abrasivas Diamantada para metalfree,zircônia, alumina e cerâmica&lt;br /&gt;\r\nAplicação:&lt;br /&gt;\r\n-Para Desgaste e Acabamento em Zirconia, Cerâmica, Alumina, Emax e demais Sistemas &quot;Metalfree&quot;.&lt;br /&gt;\r\nVantagens técnicas:&lt;br /&gt;\r\n-Baixa geração de calor;&lt;br /&gt;\r\n-Extrema capacidade de remoção de material, rápido e ininterrupto;&lt;br /&gt;\r\n-Não gera fagulhas/faíscas;&lt;br /&gt;\r\n-Não gera micro trincas no trabalho a seco;&lt;br /&gt;\r\n-Ideal para o trabalho manual;&lt;br /&gt;\r\n-Diamante 100% natural;&lt;br /&gt;\r\n-Baixa rotação (10.000 RPM);&lt;br /&gt;\r\n-Silencioso e livre de vibrações (centrada);&lt;br /&gt;\r\n-Garantia de qualidade conforme norma ISO;&lt;br /&gt;\r\nMelhor viabilidade econômica:&lt;br /&gt;\r\n-Alta durabilidade;&lt;br /&gt;\r\n-Alto rendimento de corte;&lt;br /&gt;\r\n-Melhor relação custo/benefício;&lt;br /&gt;\r\nO que são polidores diamantados?&lt;br /&gt;\r\nSão polidores de alto desempenho com grande quantidade de diamantes naturais os quais proporcionam um polimento de altíssima qualidade, baixíssimo aquecimento e alto brilho.&lt;br /&gt;\r\nSistema de retificar/lapidar diamantado com as excepcionais propriedades abrasivas através da liga especial diamantada. Para o trabalho/beneficiamento de superfícies cerâmicas.&amp;nbsp;&lt;br /&gt;\r\nEm razão do desbaste com baixa geração de calor e alta remoção de material o sistema de desbaste e polimento é especialmente recomendado para o trabalho com cerâmica e zircônia..&lt;/p&gt;\r\n', '', '', ''),
(2835, 2, ' PEDRA ABRAS. DIAM. #183567', '&lt;p&gt;Pedras Abrasivas Diamantada para metalfree,zircônia, alumina e cerâmica&lt;br /&gt;\r\nAplicação:&lt;br /&gt;\r\n-Para Desgaste e Acabamento em Zirconia, Cerâmica, Alumina, Emax e demais Sistemas &quot;Metalfree&quot;.&lt;br /&gt;\r\nVantagens técnicas:&lt;br /&gt;\r\n-Baixa geração de calor;&lt;br /&gt;\r\n-Extrema capacidade de remoção de material, rápido e ininterrupto;&lt;br /&gt;\r\n-Não gera fagulhas/faíscas;&lt;br /&gt;\r\n-Não gera micro trincas no trabalho a seco;&lt;br /&gt;\r\n-Ideal para o trabalho manual;&lt;br /&gt;\r\n-Diamante 100% natural;&lt;br /&gt;\r\n-Baixa rotação (10.000 RPM);&lt;br /&gt;\r\n-Silencioso e livre de vibrações (centrada);&lt;br /&gt;\r\n-Garantia de qualidade conforme norma ISO;&lt;br /&gt;\r\nMelhor viabilidade econômica:&lt;br /&gt;\r\n-Alta durabilidade;&lt;br /&gt;\r\n-Alto rendimento de corte;&lt;br /&gt;\r\n-Melhor relação custo/benefício;&lt;br /&gt;\r\nO que são polidores diamantados?&lt;br /&gt;\r\nSão polidores de alto desempenho com grande quantidade de diamantes naturais os quais proporcionam um polimento de altíssima qualidade, baixíssimo aquecimento e alto brilho.&lt;br /&gt;\r\nSistema de retificar/lapidar diamantado com as excepcionais propriedades abrasivas através da liga especial diamantada. Para o trabalho/beneficiamento de superfícies cerâmicas.&lt;br /&gt;\r\nEm razão do desbaste com baixa geração de calor e alta remoção de material o sistema de desbaste e polimento é especialmente recomendado para o trabalho com cerâmica e zircônia..&lt;/p&gt;\r\n', '', '', ''),
