(3046, 2, 'POLIDOR ABRASIVO #S6NK', '&lt;p&gt;&amp;nbsp;Polidor à base de silicone impregnado com carbeto de silício. Indicado para acabamento de cerâmica, proporciona um brilho mate. &amp;nbsp;Rotação Indicada: 7'' - 15000 rpm&lt;br /&gt;\r\nFormato de Ponta.&lt;/p&gt;\r\n', '', '', ''),
