(39019, 7, 'admin', 'sale', 'order.php', 'text_city_postal_match', 'City Postal Match:<br /><span class="help">Whether billing city and state match zipcode. Currently available for US addresses only, returns empty string outside the US.</span>'),
(39020, 7, 'admin', 'sale', 'order.php', 'text_ship_city_postal_match', 'Shipping City Postal Match:<br /><span class="help">Whether shipping city and state match zipcode. Currently available for US addresses only, returns empty string outside the US.</span>'),
(39021, 7, 'admin', 'sale', 'order.php', 'text_score', 'Score:<br /><span class="help">Overall fraud score based on outputs listed above. This is the original fraud score, and is based on a simple formula. It has been replaced with risk score (see below), but is kept for backwards compatibility.</span>'),
(39022, 7, 'admin', 'sale', 'order.php', 'text_explanation', 'Explanation:<br /><span class="help">A brief explanation of the score, detailing what factors contributed to it, according to our formula. Please note this corresponds to the score, not the riskScore.</span>'),
(39023, 7, 'admin', 'sale', 'order.php', 'text_risk_score', 'Risk Score:<br /><span class="help">New fraud score representing the estimated probability that the order is fraud, based off of analysis of past minFraud transactions. Requires an upgrade for clients who signed up before February 2007.</span>'),
(39024, 7, 'admin', 'sale', 'order.php', 'text_queries_remaining', 'Queries Remaining:<br /><span class="help">Number of queries remaining in your account, can be used to alert you when you may need to add more queries to your account.</span>'),
