(43904, 8, 'admin', 'sale', 'order.php', 'text_is_trans_proxy', 'Is Transparent Proxy:<br /><span class="help">Whether IP address is in our database of known transparent proxy servers, returned if forwardedIP is passed as an input.</span>'),
(43905, 8, 'admin', 'sale', 'order.php', 'text_free_mail', 'Free Mail:<br /><span class="help">Whether e-mail is from free e-mail provider (free e-mail = higher risk).</span>'),
(43906, 8, 'admin', 'sale', 'order.php', 'text_carder_email', 'Carder Email:<br /><span class="help">Whether e-mail is in database of high risk e-mails.</span>'),
(43907, 8, 'admin', 'sale', 'order.php', 'text_high_risk_username', 'High Risk Username:<br /><span class="help">Whether usernameMD5 input is in database of high risk usernames. Only returned if usernameMD5 is included in inputs.</span>'),
(43908, 8, 'admin', 'sale', 'order.php', 'text_high_risk_password', 'High Risk Password:<br /><span class="help">Whether passwordMD5 input is in database of high risk passwords. Only returned if passwordMD5 is included in inputs.</span>'),
(43909, 8, 'admin', 'sale', 'order.php', 'text_bin_match', 'Bin Match:<br /><span class="help">Whether country of issuing bank based on BIN number matches billing address country.</span>'),
(43910, 8, 'admin', 'sale', 'order.php', 'text_bin_country', 'Bin Country:<br /><span class="help">Country Code of the bank which issued the credit card based on BIN number.</span>'),
(43911, 8, 'admin', 'sale', 'order.php', 'text_bin_name_match', 'Bin Name Match:<br /><span class="help">Whether name of issuing bank matches inputted  BIN name. A return value of Yes provides a positive indication that cardholder is in possession of credit card.</span>'),
(43912, 8, 'admin', 'sale', 'order.php', 'text_bin_name', 'Bin Name:<br /><span class="help">Name of the bank which issued the credit card based on BIN number. Available for approximately 96% of BIN numbers.</span>'),
(43913, 8, 'admin', 'sale', 'order.php', 'text_bin_phone_match', 'Bin Phone Match:<br /><span class="help">Whether customer service phone number matches inputed BIN Phone. A return value of Yes provides a positive indication that cardholder is in possession of credit card.</span>'),
(43914, 8, 'admin', 'sale', 'order.php', 'text_bin_phone', 'Bin Phone:<br /><span class="help">Customer service phone number listed on back of credit card. Available for approximately 75% of BIN numbers. In some cases phone number returned may be outdated.</span>'),
(43915, 8, 'admin', 'sale', 'order.php', 'text_customer_phone_in_billing_location', 'Customer Phone Number in Billing Location:<br /><span class="help">Whether the customer phone number is in the billing zip code. A return value of Yes provides a positive indication that the phone number listed belongs to the cardholder. A return value of No indicates that the phone number may be in a different area, or may not be listed in our database. NotFound is returned when the phone number prefix cannot be found in our database at all. Currently we only support US Phone numbers.</span>'),
(43916, 8, 'admin', 'sale', 'order.php', 'text_ship_forward', 'Shipping Forward:<br /><span class="help">Whether shipping address is in database of known mail drops.</span>'),
(43917, 8, 'admin', 'sale', 'order.php', 'text_city_postal_match', 'City Postal Match:<br /><span class="help">Whether billing city and state match zipcode. Currently available for US addresses only, returns empty string outside the US.</span>'),
(43918, 8, 'admin', 'sale', 'order.php', 'text_ship_city_postal_match', 'Shipping City Postal Match:<br /><span class="help">Whether shipping city and state match zipcode. Currently available for US addresses only, returns empty string outside the US.</span>'),
(43919, 8, 'admin', 'sale', 'order.php', 'text_score', 'Score:<br /><span class="help">Overall fraud score based on outputs listed above. This is the original fraud score, and is based on a simple formula. It has been replaced with risk score (see below), but is kept for backwards compatibility.</span>'),
(43920, 8, 'admin', 'sale', 'order.php', 'text_explanation', 'Explanation:<br /><span class="help">A brief explanation of the score, detailing what factors contributed to it, according to our formula. Please note this corresponds to the score, not the riskScore.</span>'),
(43921, 8, 'admin', 'sale', 'order.php', 'text_risk_score', 'Risk Score:<br /><span class="help">New fraud score representing the estimated probability that the order is fraud, based off of analysis of past minFraud transactions. Requires an upgrade for clients who signed up before February 2007.</span>'),
(43922, 8, 'admin', 'sale', 'order.php', 'text_queries_remaining', 'Queries Remaining:<br /><span class="help">Number of queries remaining in your account, can be used to alert you when you may need to add more queries to your account.</span>'),
(43923, 8, 'admin', 'sale', 'order.php', 'text_maxmind_id', 'Maxmind ID:<br /><span class="help">Unique identifier, used to reference transactions when reporting fraudulent activity back to MaxMind. This reporting will help MaxMind improve its service to you and will enable a planned feature to customize the fraud scoring formula based on your chargeback history.</span>'),
